package mongo.gen;import cn.javaplus.db.mongo.CollectionFetcher;public class Daos {	private static CollectionFetcher fetcher;	public static AchieveTaskDao getAchieveTaskDao() {		return new AchieveTaskDao(fetcher.getCollection("AchieveTask"));	}	public static DailyTaskDao getDailyTaskDao() {		return new DailyTaskDao(fetcher.getCollection("DailyTask"));	}	public static LoginDataDao getLoginDataDao() {		return new LoginDataDao(fetcher.getCollection("LoginData"));	}	public static CreateDataDao getCreateDataDao() {		return new CreateDataDao(fetcher.getCollection("CreateData"));	}	public static KeyValueDao getKeyValueDao() {		return new KeyValueDao(fetcher.getCollection("KeyValue"));	}	public static LogDao getLogDao() {		return new LogDao(fetcher.getCollection("Log"));	}	public static void setCollectionFetcher(CollectionFetcher fetcher) {		Daos.fetcher = fetcher;	}}